\begin{equation}
\begin{array}{ccc}
(\mu_j-x)^2 					&	< 		&	(\mu_k-x)^2\\
\mu_j^2 + x^2- 2\mu_j x 		&	< 		&	\mu_k^2 + x^2- 2\mu_k x\\
\frac{1}{2} \mu_j^2 - \mu_j x 	&	< 		&	\frac{1}{2} \mu_k^2 - \mu_k x\\
x(\mu_k -\mu_j) - \frac{1}{2} \left(\mu_k^2 -\mu_j^2 \right) 	&	< 		&	0\\
(\mu_k -\mu_j)\left(x - \frac{1}{2} \left(\mu_k + \mu_j \right)\right) 	&	< 		&	0
\end{array}
\end{equation}
